import React, { Component } from 'react';
import Slider from "react-slick";
import { Card } from 'antd';
import 'antd/dist/antd.css';

const { Meta } = Card;

class Case extends Component {
    render() {
        const slider_adopt = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 3,
            slidesToScroll: 3
        };
        return (
            <section className="top-products">
                <div className="container">
                    <h1 className="section-heading">Adoption</h1>
                    <div class="slider-adoption">
                        <Slider className="food-slider" {...slider_adopt}>
                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="https://res.cloudinary.com/lucy123/image/upload/v1609064179/test/vravk16zxbeujjz55utv.png" />}
                        >
                            <Meta
                            title="Europe Street beat"
                            description="www.instagram.com"
                            />
                        </Card>
                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                        >
                            <Meta
                            title="Europe Street beat"
                            description="www.instagram.com"
                            />
                        </Card>
                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                        >
                            <Meta
                            title="Europe Street beat"
                            description="www.instagram.com"
                            />
                        </Card>
                        <Card
                            hoverable
                            style={{ width: 240 }}
                            cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                        >
                            <Meta
                            title="Europe Street beat"
                            description="www.instagram.com"
                            />
                        </Card>
                        </Slider>
                    </div>
                </div>
            </section>
        );
    }
}


export default Case;
